import "./App.css";
import Navbar from "./components/NavBar/NavBar";
import { Fragment, useEffect, useState } from "react";

function App() {
  const [data, setData] = useState(null);

  useEffect(() => {
    fetch("/api")
      .then((res) => res.json())
      .then((data) => setData(data.message));
  }, []);

  return (
    <Fragment>
      <Navbar />
    </Fragment>
  );
}

export default App;
